    import React, {Component} from 'react';
    import PropTypes from 'prop-types';
    import {connect} from 'react-redux';
    import {AddProduct} from '../Actions/PostDataActions';

    class Add extends Component {

        constructor(props) {
            super(props);
            this.state = {
                name: '',
                description: '',
                price: '',
                images: [{
                    name: '',
                    url: ''
                }, {
                    name: '',
                    url: ''
                }, {
                    name: '',
                    url: ''
                }]
            };

            this.onChange = this.onChange.bind(this);
            this.onSubmit = this.onSubmit.bind(this);
        };

        onSubmit = (event) => {
            event.preventDefault();
            const item = {
                name: this.state.name,
                description: this.state.description,
                price: this.state.price,
                images: [{
                    name: this.state.name,
                    url: "data:image/png;base64,"
                }, {
                    name: this.state.name,
                    url: "data:image/png;base64,"
                }, {
                    name: this.state.name,
                    url: "data:image/png;base64,"
                }]
            };
            this.props.AddProduct(item);
        };

        onChange = (event) => {
            this.setState({[event.target.name]: event.target.value});
        };

        onClick = (event) => {
            alert('added');
        }

        render() {

            return (
                <div className="add">
                    <h1 className="add__title">enter New product</h1> 
                    <form className="add-form" onSubmit={this.onSubmit}>
                        <label className="name-label">
                            <h3 className="name-label__title">Product name</h3>
                            <input className="name-label__input" type="text" name="name" value={this.state.name} onChange={this.onChange} />
                        </label>
    
                        <label className="description-label">
                            <h3 className="description-label__title">Product description</h3>
                            <textarea className="description-label__input" type="text" name="description" value={this.state.description} onChange={this.onChange} />
                        </label>
    
                        <label className="price-label">
                            <h3 className="price-label__title">Product price / kg</h3>
                            <input className="price-label__input" type="number" name="price" value={this.state.price} onChange={this.onChange} />
                        </label>
    
                        <label className="upload-label">
                            <h3 className="upload-label__title">Product image</h3>
                            <input className="upload-label__input" type="file" name="url" />
                        </label>
                        <button className="add-form__submit" type="submit" onClick={this.onClick}>Add</button>
                    </form>
                </div>
            );
        };
    };

    Add.propTypes = {
        AddProduct: PropTypes.func.isRequired
    };
    
    export default connect(null, {AddProduct})(Add);

